class InvoiceModels extends StatefulWidget {
  const InvoiceModels({Key? key}) : super(key: key);

  @override
  State<InvoiceModels> createState() => _InvoiceModelsState();
}

class _InvoiceModelsState extends State<InvoiceModels> {
  final PageController controller = PageController(initialPage: 1);
  late Size _size;
  Set<String> models = {'Style 1', 'Style 2', 'Style 3', 'Style 4', 'Style 5'};
  int _position = 0;

  @override
  Widget build(BuildContext context) {
    _size = MediaQuery.of(context).size;
    return Scaffold(
      appBar: AppBar(
        title: const Text('Invoice model'),
      ),
      body: Column(
        children: [
          SizedBox(
              height: _size.height - 150,
              child: Container(
                color: grey,
                child: PageView.builder(
                  onPageChanged: _pageChanged,
                  controller: controller,
                  itemCount: models.length,
                  itemBuilder: (context, index) {
                    return index == 0 ? style1() : defaultStyle();
                  },
                ),
              )),
          Padding(
            padding: const EdgeInsets.all(8.0),
            child: Center(
              child: Text(
                models.elementAt(_position),
                style: const TextStyle(fontWeight: FontWeight.bold),
              ),
            ),
          ),
          Indicator(
            controller: controller,
            itemCount: models.length,
          ),
        ],
      ),
    );
  }

  defaultStyle() {
    String dataHtml = '''
    <html>
    <body>
    <h>default style</h>
    </body>
    </html>''';
    final GlobalKey _globalKey = GlobalKey();
    return Column(children: [
      Expanded(
          child: RepaintBoundary(
        key: _globalKey,
        child: WebView(
            initialUrl: '',
            // javascriptMode: JavascriptMode.unrestricted,
            onWebViewCreated: (contr) {
              contr.loadUrl(Uri.dataFromString(dataHtml,
                      mimeType: 'text/html', encoding: utf8)
                  .toString());
            }),
      )),
    ]);
  }

